const wss = new Websocket.Server({ port: 4000 })

wss.on("connection", (ws) => {
  //  connection

  ws.on("message", (message) => {
    //  data   client 
  })

  ws.on("close", () => {
    //  Connection   Browser
    ws.send("websocket disconnected !")
  })

  ws.send("websocket connected !")
})
export default wss

