  list_covid19_Russia,
  list_covid19_Belgium,
  list_covid19_Netherlands,
  list_covid19_Brazil,
} from "../../domains/covid19/index"
import { broadcastData } from "../../utils/domains"

@route("/covid19")
class covid19 {
